import styled from "styled-components";
function Header() {
    const HeaderContainer = styled.div`
        background : black;
        color   :   white;
        padding :   24px 24px;
        display :   flex;
        flex-direction  :   row;
    `;

    const LogoContainer = styled.div`
        color   :   white;
        padding :   8px;
        display :   flex;
        flex-direction  :   row;
    `;

    return (
    <div>
    <HeaderContainer>
        <LogoContainer>PLAN R</LogoContainer>
    </HeaderContainer>
    </div>
  );
}

export default Header;
